class App extends Component {
  render() {
    return (
      <div className="App">
      <Particles className='particles'
              params={{particles: {
                number: {
                  value:30,

                density: {
                  enable:true,
                  value_area:800
                }
              }
              }}}
            />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm />
        {/*
              <FaceRecognition />*/}
      </div>
    );
  }
}

export default App;
